import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
// Import Style
import { IconBars } from './styled';

const Button = ( props ) => (
  	<IconBars>
  		<FontAwesomeIcon icon="bars" />
	</IconBars>
);

export default(Button);
